import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';

function ProjectDashboard({ user }) {
  const { projectId } = useParams();
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate('/');
  };

  return (
    <div style={styles.background}>
      <div style={styles.card}>
        <h2 style={styles.header}>Welcome, {user}!</h2>
        <p style={styles.subheader}>
          You are viewing <strong>Project ID: {projectId}</strong>
        </p>

        <button style={styles.button}>View Project Details</button>
        <button style={styles.button}>Update Project Info</button>
        <button style={styles.logoutButton} onClick={handleLogout}>Logout</button>
      </div>
    </div>
  );
}

const styles = {
  background: {
    display: 'flex',
    height: '100vh',
    background: 'linear-gradient(to right, #74ebd5, #ACB6E5)',
    justifyContent: 'center',
    alignItems: 'center',
  },
  card: {
    backgroundColor: 'white',
    padding: '40px',
    borderRadius: '12px',
    boxShadow: '0 10px 25px rgba(0, 0, 0, 0.1)',
    width: '350px',
    textAlign: 'center',
  },
  header: {
    marginBottom: '10px',
  },
  subheader: {
    marginBottom: '30px',
    fontSize: '16px',
  },
  button: {
    width: '100%',
    padding: '10px',
    backgroundColor: '#4EA5FF',
    color: 'white',
    border: 'none',
    borderRadius: '6px',
    fontSize: '14px',
    marginBottom: '10px',
    cursor: 'pointer',
  },
  logoutButton: {
    width: '100%',
    padding: '10px',
    backgroundColor: '#F44336',
    color: 'white',
    border: 'none',
    borderRadius: '6px',
    fontSize: '14px',
    marginTop: '10px',
    cursor: 'pointer',
  },
};

export default ProjectDashboard;
